INSERT INTO `post` VALUES (85, 1, '🌟 PHẦN THƯỞNG CÁC MỐC NẠP 🌟', '<p>🌟 <strong>ƯU Đ&Atilde;I NẠP TIỀN ĐẶC BIỆT!</strong> 🌟</p>\r\n\r\n<p>🌈 <strong>Mốc 500k - H&ograve;a m&igrave;nh trong biển hồng ngọc!</strong> 💰 Nạp đủ 500k v&agrave; nhận ngay:</p>\r\n\r\n<ul>\r\n	<li>🎁 Bonus 50k hồng ngọc</li>\r\n	<li>🌟 20 điểm quyền năng</li>\r\n	<li>🌠 1 bộ 1 sao để tỏa s&aacute;ng trong h&agrave;nh tr&igrave;nh của bạn!</li>\r\n</ul>\r\n\r\n<p>🚀 <strong>Mốc 1 triệu - Vượt qua đỉnh cao c&ugrave;ng biểu tượng 5 sao!</strong> 💰 Nạp đủ 1 triệu v&agrave; hưởng ngay:</p>\r\n\r\n<ul>\r\n	<li>🎁 Bonus 200k hồng ngọc</li>\r\n	<li>🌟 100 điểm quyền năng</li>\r\n	<li>🌠 5 bộ 1 sao để trở th&agrave;nh ng&ocirc;i sao s&aacute;ng nhất!</li>\r\n</ul>\r\n\r\n<p>✨ <strong>Mốc 5 triệu - Đỉnh cao của sức mạnh v&agrave; quyền lực!</strong> 💰 Nạp đủ 5 triệu v&agrave; thu về:</p>\r\n\r\n<ul>\r\n	<li>🎁 Bonus 500k hồng ngọc</li>\r\n	<li>🌟 500 điểm quyền năng</li>\r\n	<li>🌠 20 bộ 1 sao để l&agrave;m chủ mọi th&aacute;ch thức!</li>\r\n</ul>\r\n\r\n<p>🎉 <strong>Kh&aacute;m ph&aacute; cảm gi&aacute;c của sự đẳng cấp!</strong> 🎉</p>\r\n\r\n<p>Phần qu&agrave; sẽ được nhận tại Npc L&yacute; Tiểu Nương tại Đảo Kame khi tổng nạp bạn đủ c&aacute;c mốc</p>\r\n', '2023-11-20 22:00:47', 3, 1161, 0);
INSERT INTO `post` VALUES (86, 1, '  🌟 Hướng Dẫn Tân Thủ!  🌟 ', '<p><strong>CH&Agrave;O MỪNG T&Acirc;N THỦ ĐẾN VỚI THẾ GIỚI NGỌC RỒNG SAGA!</strong></p>\r\n\r\n<p>🌟 <strong>Những Ưu Đ&atilde;i Đặc Biệt D&agrave;nh Cho Bạn:</strong></p>\r\n\r\n<p>🔥 <strong>Free V&agrave;ng?</strong> - C&oacute; chứ! Tận hưởng h&agrave;nh tr&igrave;nh kh&ocirc;ng giới hạn với v&agrave;ng miễn ph&iacute; từ server!</p>\r\n\r\n<p>💎 <strong>Free Ngọc?</strong> - Tất nhi&ecirc;n! Mỗi bước tiến của bạn đều được hỗ trợ bằng những vi&ecirc;n ngọc qu&yacute; gi&aacute;!</p>\r\n\r\n<p>🌈 <strong>Free S&eacute;t K&iacute;ch Hoạt?</strong> - Đ&uacute;ng vậy! Được trang bị những bộ trang phục mạnh mẽ m&agrave; kh&ocirc;ng tốn một xu!</p>\r\n\r\n<p>🚀 <strong>Kh&aacute;m Ph&aacute; Hết M&igrave;nh:</strong></p>\r\n\r\n<p>✨ <strong>N&acirc;ng SKH Level 2:</strong></p>\r\n\r\n<ul>\r\n	<li>Đạt được s&eacute;t k&iacute;ch hoạt level 2 với 5 m&oacute;n Thần Linh v&agrave; 1 m&oacute;n k&iacute;ch hoạt level 1. Tăng tỉ lệ th&agrave;nh c&ocirc;ng l&ecirc;n 40% với 1 vi&ecirc;n 1 sao!</li>\r\n</ul>\r\n\r\n<p>🍽️ <strong>Thức Ăn v&agrave; M&oacute;n Hủy Diệt:</strong></p>\r\n\r\n<ul>\r\n	<li>Tận dụng 99 thức ăn v&agrave; 100 thỏi v&agrave;ng để đổi lấy m&oacute;n hủy diệt, c&oacute; khả năng mở ra 15%!</li>\r\n</ul>\r\n\r\n<p>🔥 <strong>G&acirc;y Sốc với Dame L&ecirc;n Toppo Hakai:</strong></p>\r\n\r\n<ul>\r\n	<li>Đeo 5 m&oacute;n hủy diệt để c&oacute; thể g&acirc;y dame l&ecirc;n Toppo Hakai v&agrave; rinh về những phần thưởng gi&aacute; trị từ hắn!</li>\r\n</ul>\r\n\r\n<p>🌌 <strong>Ngọc Rồng Ở Đ&acirc;u?</strong></p>\r\n\r\n<ul>\r\n	<li>Kh&aacute;m ph&aacute; c&aacute;c boss từ 3 sao đến 7 sao, c&ugrave;ng doanh trại v&agrave; bản đồ kho b&aacute;u để thu được ngọc rồng qu&yacute; gi&aacute;!</li>\r\n</ul>\r\n\r\n<p>👥 <strong>Đệ Tử Zenno:</strong></p>\r\n\r\n<ul>\r\n	<li>Đệ tử Zenno mạnh mẽ, gi&uacute;p tăng 15% chỉ số khi hợp thể. N&acirc;ng cấp với c&aacute; ti&ecirc;n tri để trở n&ecirc;n v&ocirc; c&ugrave;ng mạnh mẽ!</li>\r\n</ul>\r\n\r\n<p>🛡️ <strong>N&acirc;ng Cấp H&igrave;nh Dạng Cấp 2:</strong></p>\r\n\r\n<ul>\r\n	<li>H&atilde;y chiến đấu với Black Goku v&agrave; Zamasu để kiếm mảnh vỡ, n&acirc;ng cấp b&ocirc;ng tai cấp 2 v&agrave; mở chỉ số!</li>\r\n</ul>\r\n\r\n<p>🌐 <strong>V&agrave; C&ograve;n Rất Nhiều T&iacute;nh Năng Kh&aacute;c:</strong></p>\r\n\r\n<ul>\r\n	<li>Rương 11, Boss 22h, Boss 12h, Mabu 14, Bản Đồ Kho B&aacute;u... c&ugrave;ng v&ocirc; số hoạt động sẽ được bổ sung với những phần thưởng hấp dẫn!</li>\r\n</ul>\r\n\r\n<p>🔔 <strong>H&atilde;y Đảm Bảo Bạn Lu&ocirc;n Cập Nhật Update!</strong></p>\r\n\r\n<ul>\r\n	<li>Đội ngũ admin sẽ kh&ocirc;ng ngừng l&agrave;m mới v&agrave; cập nhật, đảm bảo bạn c&oacute; những trải nghiệm chơi game l&acirc;u d&agrave;i v&agrave; hấp dẫn nhất!</li>\r\n</ul>\r\n\r\n<p><strong>Ch&uacute;c bạn c&oacute; những gi&acirc;y ph&uacute;t vui chơi thăng hoa trong Thế Giới Ngọc Rồng Saga!</strong> 🌟🐉</p>\r\n', '2023-11-20 22:14:59', 3, 1601, 0);
INSERT INTO `post` VALUES (87, 1, 'Cách Kiếm Hồng Ngọc!', '<p><strong>Nhận Hồng Ngọc Tại Ngọc Rồng Saga:</strong></p>\r\n\r\n<p>🌌 <strong>B&ograve; Mộng - Nơi Hạnh Ph&uacute;c Bắt Đầu:</strong></p>\r\n\r\n<ul>\r\n	<li>Trải nghiệm niềm vui của B&ograve; Mộng với 2 mục qu&agrave; miễn ph&iacute; v&agrave; nhiệm vụ hằng ng&agrave;y.</li>\r\n	<li>Ho&agrave;n th&agrave;nh nhiệm vụ để nhận ngay những vi&ecirc;n hồng ngọc đầy gi&aacute; trị.</li>\r\n</ul>\r\n\r\n<p>🌟 <strong>Điểm Danh Hằng Ng&agrave;y - Dấu Ấn Cuộc Sống:</strong></p>\r\n\r\n<ul>\r\n	<li>Mỗi ng&agrave;y, h&atilde;y đến v&agrave; điểm danh để đắm ch&igrave;m trong sự phấn kh&iacute;ch của ngọc rồng.</li>\r\n	<li>K&iacute;ch hoạt th&agrave;nh vi&ecirc;n để nh&acirc;n đ&ocirc;i hạnh ph&uacute;c với x2 số lượng hồng ngọc từ điểm danh.</li>\r\n</ul>\r\n\r\n<p>🔥 <strong>Săn Boss - H&agrave;nh Tr&igrave;nh Đến Từ H&agrave;nh Tinh Fide:</strong></p>\r\n\r\n<ul>\r\n	<li>Đối mặt với boss tiểu đội Namek, những người gi&agrave;u c&oacute; đến từ h&agrave;nh tinh Fide.</li>\r\n	<li>Khi ch&uacute;ng bị ti&ecirc;u diệt, nhận ngay những vi&ecirc;n hồng ngọc m&agrave; ch&uacute;ng mang theo từ h&agrave;nh tr&igrave;nh x&acirc;m chiếm tr&aacute;i đất.</li>\r\n</ul>\r\n\r\n<p>🎉 <strong>Chinh Phục C&aacute;c Hoạt Động Hằng Ng&agrave;y:</strong></p>\r\n\r\n<ul>\r\n	<li>Tham gia hoạt động hằng ng&agrave;y với sự hứng khởi v&agrave; niềm đam m&ecirc;.</li>\r\n	<li>Ho&agrave;n th&agrave;nh nhiệm vụ, đổi lấy niềm vui v&agrave; phần thưởng hồng ngọc.</li>\r\n</ul>\r\n\r\n<p>🌈 <strong>H&ograve;a M&igrave;nh Trong Thế Giới Ngọc Rồng Saga:</strong></p>\r\n\r\n<ul>\r\n	<li>Kh&aacute;m ph&aacute; c&aacute;c t&iacute;nh năng đặc biệt kh&aacute;c v&agrave; tận hưởng sự phong ph&uacute; của thế giới ngọc rồng.</li>\r\n	<li>Mỗi hoạt động đều l&agrave; một cơ hội để nhận th&ecirc;m hồng ngọc v&agrave; trải nghiệm v&ocirc; số niềm vui!</li>\r\n</ul>\r\n\r\n<p>💫 <strong>H&atilde;y Đảm Bảo Rằng Bạn Lu&ocirc;n Ở Đỉnh Cao Niềm Đam M&ecirc;!</strong> 🚀🌟</p>\r\n\r\n<p>V&agrave; cuối c&ugrave;ng l&agrave; nạp c&aacute;c bạn nh&eacute; =)))</p>\r\n', '2023-11-20 22:21:01', 3, 955, 0);
INSERT INTO `post` VALUES (88, 1, '🕒 Tính Năng Hỗ Trợ Nhiệm Vụ  🕒 ', '<p>🌟 <strong>Nhiệm Vụ Th&aacute;ch Thức? Kh&ocirc;ng C&ograve;n L&agrave; Vấn Đề!</strong></p>\r\n\r\n<p>🚀 <strong>Thử Nghiệm Số Lượng Người Chơi:</strong></p>\r\n\r\n<ul>\r\n	<li>Sau bản test, ch&uacute;ng t&ocirc;i đ&atilde; lắng nghe &yacute; kiến của cộng đồng về kh&oacute; khăn trong việc ho&agrave;n th&agrave;nh nhiệm vụ do số lượng người chơi qu&aacute; đ&ocirc;ng.</li>\r\n</ul>\r\n\r\n<p>🔧 <strong>Cải Thiện Đ&aacute;ng Kể:</strong></p>\r\n\r\n<ul>\r\n	<li>Đ&aacute;p ứng nhanh ch&oacute;ng với phản hồi, ch&uacute;ng t&ocirc;i đ&atilde; tiến h&agrave;nh điều chỉnh mở để tạo ra một trải nghiệm chơi game mượt m&agrave; hơn.</li>\r\n</ul>\r\n\r\n<p>🌌 <strong>Cải Thiện T&iacute;nh Năng:</strong></p>\r\n\r\n<ul>\r\n	<li>Tăng số lượng boss nhiệm vụ để tạo sự đa dạng v&agrave; hứng th&uacute;.</li>\r\n	<li>Giảm thời gian ra boss, gi&uacute;p người chơi nhanh ch&oacute;ng tham gia v&agrave;o cuộc phi&ecirc;u lưu.</li>\r\n</ul>\r\n\r\n<p>🕒 <strong>Khung Giờ Hỗ Trợ Nhiệm Vụ:</strong></p>\r\n\r\n<ul>\r\n	<li>Thiết lập khung giờ hỗ trợ nhiệm vụ mỗi giờ, với c&aacute;c giờ chẵn (2, 4, 6, 8, 10).</li>\r\n	<li>Người chơi kh&ocirc;ng tham gia nhiệm vụ trong khoảng thời gian n&agrave;y sẽ kh&ocirc;ng v&agrave;o được khu vực c&oacute; boss nhiệm vụ, tạo ra cơ hội c&ocirc;ng bằng cho tất cả.</li>\r\n</ul>\r\n\r\n<p>🎉 <strong>Sự Thay Đổi Mang Lại Trải Nghiệm Dễ D&agrave;ng:</strong></p>\r\n\r\n<ul>\r\n	<li>Những cải tiến n&agrave;y hứa hẹn gi&uacute;p cộng đồng trải nghiệm dễ d&agrave;ng hơn, mặc d&ugrave; vẫn giữ nguy&ecirc;n mức độ th&aacute;ch thức do sự đ&ocirc;ng đ&uacute;c của cộng đồng.</li>\r\n</ul>\r\n\r\n<p>🌈 <strong>Chinh Phục Nhiệm Vụ C&ugrave;ng Người Chơi Kh&aacute;c:</strong></p>\r\n\r\n<ul>\r\n	<li>Với sự tăng cường v&agrave; t&iacute;nh cạnh tranh, trải nghiệm chơi game sẽ trở n&ecirc;n hấp dẫn hơn bao giờ hết!</li>\r\n</ul>\r\n\r\n<p><strong>Tham Gia Ngọc Rồng Saga Ngay H&ocirc;m Nay v&agrave; H&ograve;a M&igrave;nh Trong H&agrave;nh Tr&igrave;nh Đầy Hứng Khởi!</strong> 🌟🐉</p>\r\n', '2023-11-20 22:42:07', 3, 1023, 0);
INSERT INTO `post` VALUES (89, 1, 'Cập Nhật 22/11 Cho Ngọc Rồng Saga', '<p><strong>Cập Nhật Cho Ngọc Rồng Saga:</strong></p>\r\n\r\n<p>🛠️ <strong>Sửa Giờ Bảo Tr&igrave;:</strong></p>\r\n\r\n<ul>\r\n	<li>Tận hưởng trải nghiệm mượt m&agrave; hơn với giờ bảo tr&igrave; tự động v&agrave;o 5h s&aacute;ng v&agrave; 5h chiều.</li>\r\n	<li>Đảm bảo người chơi c&oacute; đủ thời gian thư gi&atilde;n v&agrave; chờ đ&oacute;n những n&acirc;ng cấp mới!</li>\r\n</ul>\r\n\r\n<p>💼 <strong>Bổ Xung Hồng Ngọc v&agrave;o Rương 11:</strong></p>\r\n\r\n<ul>\r\n	<li>Mở rộng cơ hội ph&aacute;t hiện với sự th&ecirc;m v&agrave;o hồng ngọc trong Rương 11.</li>\r\n	<li>Ch&uacute;ng đang chờ đợi để trở th&agrave;nh của bạn trong những ng&oacute;c ng&aacute;ch b&iacute; mật của tr&ograve; chơi!</li>\r\n</ul>\r\n\r\n<p>🐲 <strong>Boss Tiểu Đội S&aacute;t Thủ Namek:</strong></p>\r\n\r\n<ul>\r\n	<li>Ch&iacute;nh thức xuất hiện boss tiểu đội S&aacute;t Thủ Namek tr&ecirc;n đấu trường.</li>\r\n	<li>H&atilde;y chiến đấu với họ để gi&agrave;nh được những vi&ecirc;n hồng ngọc v&agrave; thỏi v&agrave;ng qu&yacute; gi&aacute; từ h&agrave;nh tr&igrave;nh x&acirc;m chiếm tr&aacute;i đất!</li>\r\n</ul>\r\n\r\n<p>⚔️ <strong>Boss Toppo - Th&aacute;ch Thức Tối Cao:</strong></p>\r\n\r\n<ul>\r\n	<li>Đối mặt với sự xuất hiện của boss Toppo, người bảo vệ v&ocirc; c&ugrave;ng mạnh mẽ.</li>\r\n	<li>G&acirc;y s&aacute;t thương v&agrave;o Toppo bằng c&aacute;ch mặc đồ hủy diệt để nhận những đồ thi&ecirc;n sứ chỉ số ngẫu nhi&ecirc;n từ hắn.</li>\r\n</ul>\r\n\r\n<p>📘 <strong>Tiểu Đội YD Rơi B&iacute; K&iacute;p:</strong></p>\r\n\r\n<ul>\r\n	<li>Nhiệm vụ truy đuổi học thuật tăng cao với b&iacute; k&iacute;p từ Tiểu Đội YD.</li>\r\n	<li>H&atilde;y thu thập v&agrave; kh&aacute;m ph&aacute; những b&iacute; mật ẩn sau những trang s&aacute;ch qu&yacute; gi&aacute; n&agrave;y.</li>\r\n</ul>\r\n\r\n<p><strong>Thưởng Thức H&agrave;nh Tr&igrave;nh Mới v&agrave; Những Kh&aacute;m Ph&aacute; B&iacute; Ẩn Tại Ngọc Rồng Saga!</strong> 🌌🔮</p>\r\n', '2023-11-22 14:40:52', 3, 551, 0);
INSERT INTO `post` VALUES (90, 1, '🌟 PHẦN THƯỞNG CÁC MỐC NẠP 🌟', '<p>🌟 <strong>Ưu Đ&atilde;i Nạp Tiền Hấp Dẫn Tại Ngọc Rồng Saga!</strong></p>\r\n\r\n<p>🎉 <strong>Mốc Nạp 20k&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Nạp 20k để nhận ngay 1 thẻ đổi skill 2,3,4,5 đệ cho mỗi loại x1</li>\r\n</ul>\r\n\r\n<p>🌈 <strong>Mốc Nạp 50k&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Đạt mốc&nbsp;50k để sở hữu ngay một gậy Thi&ecirc;n Sứ&nbsp;</li>\r\n	<li>Vũ kh&iacute; mạnh mẽ gi&uacute;p bạn tỏa s&aacute;ng trong mọi trận đấu, c&oacute; thể g&acirc;y dame l&ecirc;n Whis v&agrave; Bill</li>\r\n</ul>\r\n\r\n<p>✨ <strong>Mốc Nạp 100k - Đệ Zeno v&agrave; Hộp Cải Trang Zamasu:</strong></p>\r\n\r\n<ul>\r\n	<li>Nạp 100k để nhận ngay:\r\n	<ul>\r\n		<li>1 đệ Zeno - người đồng h&agrave;nh mạnh mẽ.</li>\r\n		<li>5 hộp cải trang Zamasu</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>💎 <strong>Mốc Nạp 2tr - Đại Tiệc Hồng Ngọc:</strong></p>\r\n\r\n<ul>\r\n	<li>Nạp 2tr v&agrave; đ&oacute;n nhận một kho b&aacute;u qu&yacute; gi&aacute;:\r\n	<ul>\r\n		<li>300k hồng ngọc - nguồn lực quan trọng cho sức mạnh của bạn.</li>\r\n		<li>10 bộ 1 sao - để thăng tiến đẳng cấp nhanh ch&oacute;ng.</li>\r\n		<li>200 điểm quyền năng</li>\r\n		<li>Phần thưởng sẽ được nhận tại 1 tab mới tại&nbsp;L&yacute; Tiểu Nương, những ai đ&atilde; nhận mốc nạp cũ sẽ kh&ocirc;ng bị ảnh hưởng</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '2023-11-23 21:31:02', 3, 1282, 1);
