INSERT INTO `task_main_template` VALUES (0, 'Nhiệm vụ đầu tiên', 'Chi tiết nhiệm vụ');
INSERT INTO `task_main_template` VALUES (1, 'Nhiệm vụ tập luyện', 'Mộc nhân được đặt nhiều tại Làng,\r\nngay trước nhà\r\nHãy đánh ngã 5 mộc nhân, sau đó quay\r\nvề nhà báo cáo với ông Gohan\r\nĐể đánh, hãy click đôi vào đối tượng\r\nThưởng 500 sức mạnh\r\nThưởng 500 tiềm năng');
INSERT INTO `task_main_template` VALUES (2, 'Nhiệm vụ tìm thức ăn', 'Tìm đến %3, tiêu diệt bọn quái %4 và nhặt về 10 đùi gà\nThưởng 1500 sức mạnh\nThưởng 1500 tiềm năng\nThưởng 300tr vàng\nHọc được kỹ năng bay');
INSERT INTO `task_main_template` VALUES (3, 'Nhiệm vụ sao băng', 'Dùng tiềm năng con có để nâng cấp\r\nHP,KI hoặc Sức đánh\r\nKiểm tra khu vực sao băng rơi tại Vách núi Morri\r\nThưởng 2 k sức mạnh\r\nThưởng 2 k tiềm năng');
INSERT INTO `task_main_template` VALUES (4, 'Nhiệm vụ thử thách', 'Khủng long mẹ sống tại Trái Đất\r\nLợn lòi mẹ sống tại Namếc\r\nQuỷ đất mẹ sống tại Xayda\r\nDùng tàu vũ trụ để di chuyển sang hành\r\ntinh khác\r\nThưởng 4 k sức mạnh\r\nThưởng 4 k tiềm năng\n');
INSERT INTO `task_main_template` VALUES (5, '', '');
INSERT INTO `task_main_template` VALUES (6, '', '');
INSERT INTO `task_main_template` VALUES (7, 'Nhiệm vụ giải cứu', 'Tìm đường đến Rừng nguyên sinh,\r\nHạ 20 con Quỷ bay\r\nThưởng 8 k sức mạnh\r\nThưởng 8 k tiềm năng\r\n');
INSERT INTO `task_main_template` VALUES (8, 'Nhiệm vụ tìm ngọc', 'Ngọc rồng 7 sao đang bị bọn Thằn\r\nlằn mẹ cướp đi tại Rừng Xương, Trái Đất.\r\nĐánh bại chúng để tìm lại.\r\nThưởng 15 k sức mạnh\r\nThưởng 15 k tiềm năng\n');
INSERT INTO `task_main_template` VALUES (9, 'Nhiệm vụ tìm ngọc', 'Tìm đường đến Karin\r\nnói chuyện với Bò Mộng\r\nkhi đụng độ Tàu Pảy Pảy hãy mau chóng bay lên tháp karin');
INSERT INTO `task_main_template` VALUES (10, 'Nhiệm vụ tìm ngọc', 'Học võ với Thần Mèo\r\nXuống rừng Karin tiêu diệt Tàu Pảy Pảy\r\nđem ngọc về cho ông %2\r\nThưởng 15 k sức mạnh\r\nThưởng 15 k tiềm năng\r\n');
INSERT INTO `task_main_template` VALUES (11, 'Nhiệm vụ bái sư', 'Tìm đường tới %11, trò chuyện với %10 và xin làm đệ tử');
INSERT INTO `task_main_template` VALUES (12, 'Nhiệm vụ gia nhập bang hội', 'Báo cáo với %2 khi bang của bạn\r\ncó từ 5 thành viên trở lên\r\nThưởng 20 k sức mạnh\r\nThưởng 20 k tiềm năng');
INSERT INTO `task_main_template` VALUES (13, 'Nhiệm vụ bang hội đầu tiên', 'Cùng phối hợp với 1 người đồng đội lên đường làm nhiệm vụ\nGợi ý:\nHeo rừng xuất hiện tại rừng Bamboo\nHeo da xanh xuất \nhiện tại núi hoa vàng\nHeo xayda xuất hiện tại rừng cọ\nHãy tới trạm tàu vũ trụ để có thể di chuyển qua các map');
INSERT INTO `task_main_template` VALUES (14, 'Nhiệm vụ bái sư', 'Đánh bọn %12 để lấy truyện\r\nDoremon tập 2\r\nThưởng 80 k sức mạnh\r\nThưởng 80 k tiềm năng\n');
INSERT INTO `task_main_template` VALUES (15, 'Nhiệm vụ bang hội thứ 2', 'Cùng ít nhất 2 thành viên trong\r\nbang tiêu diệt\r\nBulon tại Đảo Bulông(Trái Đất)\r\nUkulele tại Đông Nam Guru(Namếc)\r\nQuỷ mập tại Bờ Vực Đen(Xayda)\r\nThưởng 150 k sức mạnh\r\nThưởng 150 k tiềm năng\n');
INSERT INTO `task_main_template` VALUES (16, 'Nhiệm vụ thách đấu', 'Thách đấu và chiến thằng 10 người\r\nbất kì\r\nThưởng 150 k sức mạnh\r\nThưởng 150 k tiềm năng\n');
INSERT INTO `task_main_template` VALUES (17, 'Nhiệm vụ tiêu diệt Boss Trùm', 'Đạt 1.500.000 sức mạnh để trở\r\nthành Siêu nhân\r\nTiêu diệt Akkuman tại Thành\r\nphố Vegeta, tiêu diệt Tamborine tại Đông\r\nKarin, tiêu diệt Drum tại Thung\r\nlũng Namếc\r\nThưởng 200 k sức mạnh\r\nThưởng 200 k tiềm năng\n');
INSERT INTO `task_main_template` VALUES (18, 'Nhiệm vụ thử thách', 'Đạt 5 triệu sức mạnh\r\nTham gia và chiến thắng vòng 2 đại hội\r\nvõ thuật tại Vách núi Kakarot\r\nThưởng 500 k sức mạnh\r\nThưởng 500 k tiềm năng');
INSERT INTO `task_main_template` VALUES (19, 'Nhiệm vụ cam go', 'Đạt 15 triệu sức mạnh\r\nVào doanh trại Độc Nhãn tìm diệt\r\nTrung Úy Trắng\r\nThưởng 5 Tr sức mạnh\r\nThưởng 5 Tr tiềm năng');
INSERT INTO `task_main_template` VALUES (20, 'Nhiệm vụ bất khả thi', 'Đạt 50 triệu sức mạnh\r\nTiêu diệt bọn tay sai của Fide tại Xayda\r\nThưởng 50 Tr sức mạnh\r\nThưởng 50 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (21, 'Nhiệm vụ tìm diệt đệ tử', 'Tiêu diệt bọn đệ tử Kuku, Mập Đầu Đinh,\r\nRambo của Fide đại ca tại Xayda\r\nCui có thể biết vị trí của chúng, nếu tìm\r\nkhông thấy hãy đến gặp Cui tại thành\r\nphố Vegeta\r\nThưởng 20 Tr sức mạnh\r\nThưởng 20 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (22, 'Tiểu đội sát thủ', 'Tiêu diệt Tiểu Đội Sát Thủ do Fide đại\r\nca gọi đến tại Xayda\r\nThưởng 20 Tr sức mạnh\r\nThưởng 20 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (23, 'Fide đại ca', 'Fide đã xuất hiện tại núi khỉ vàng\r\nThưởng 20 Tr sức mạnh\r\nThưởng 20 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (24, 'Chú bé đến từ tương lai', 'Đến trái đất, rừng bamboo, rừng dương\r\nxỉ, nam Kamê tìm người lạ\r\nĐến đảo rùa đưa thuốc cho Quy Lão\r\nTheo Ca Lích đến tương lai\r\nGiúp họ diệt bọn bọ hung con\r\nThưởng 1 Tr sức mạnh\r\nThưởng 1 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (25, 'Chạm trán Rôbốt Sát Thủ lần 1', 'Hãy đến thành phố phía nam\r\nđảo balê hoặc cao nguyên\r\nCùng 2 đồng bang diệt 900 Xên con cấp 3\r\nBáo với Bunma tương lai\r\nThưởng 1 Tr sức mạnh\r\nThưởng 1 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (26, 'Chạm trán Rôbốt Sát Thủ lần 2', 'Trở về quá khứ, đến sân sau siêu thị\r\nTiêu diệt bọn Rôbốt sát thủ\r\nBáo với Bunma tương lai\r\nThưởng 1 Tr sức mạnh\r\nThưởng 1 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (27, 'Chạm trán Rôbốt Sát Thủ lần 3', 'Đến thành phố, ngọn núi, thung lũng phía Bắc\r\nTiêu diệt bọn Rôbốt sát thủ\r\nCùng 2 đồng bang diệt 800 Xên con cấp 5\r\nBáo với Bunma tương lai\r\nThưởng 1 Tr sức mạnh\r\nThưởng 1 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (28, 'Chạm trán Xên bọ hung', 'Đến thị trấn Ginder\r\nTiêu diệt Xên Bọ Hung cấp 1\r\nTiêu diệt Xên Bọ Hung cấp 2\r\nTiêu diệt Xên Bọ Hung hoàn thiện\r\nCùng 2 đồng bang diệt 700 Xên con cấp 8\r\nBáo với Bunma tương lai\r\nThưởng 1 Tr sức mạnh\r\nThưởng 1 Tr tiềm năng\r\n');
INSERT INTO `task_main_template` VALUES (29, 'Cuộc dạo chơi của Xên', 'Nâng sức đánh gốc lên 10K, đến gặp thần\r\nmèo\r\nThu thập Capsule kì bí\r\nĐến võ đài Xên Bọ Hung\r\nTiêu diệt 7 đứa con của Xên\r\nTiêu diệt Siêu Bọ Hung\r\nBáo với Bunma tương lai\r\nThưởng 1 Tr sức mạnh\r\nThưởng 1 Tr tiềm năng\n');
INSERT INTO `task_main_template` VALUES (30, 'Cuộc đối đầu không cân sức', 'Cẩn thận !!!\r\nNhững vị khách không mời mà tới\r\nthường tỏ ra nguy hiểm\n');
INSERT INTO `task_main_template` VALUES (31, 'Chạm trán người ngoài hành tinh', 'Bảo vệ hành tinh thực vật, hạ những kẻ xâm lược.\r\nThưởng 10 Tr sức mạnh\r\nThưởng 10 Tr tiềm năng');
